import fetch from 'isomorphic-unfetch';
import Layout from '../Components/Layout';
const Index = (props) =>(
    <Layout>
        <div>
         <h1>Welome to React Next JS</h1>
         {props.items.gudid.device.catalogNumber}
        </div>
    </Layout>
);

Index.getInitialProps = async function()
{
    const res = await fetch('https://accessgudid.nlm.nih.gov/api/v2/devices/lookup.json?di=08717648200274');
    const data = await res.json();


    return{
        items : data
    }
}

export default Index;
// export default  () => (<div>Hello Next.js</div>)
